import React from 'react';
import {
  Table,
  TableHead,
  TableHeading,
  TableBody,
  TableRow,
  TableData,
} from '../../Ui/Table';

export interface ProductsTableProps {
  products: any;
}

const ProductsTable: React.SFC<ProductsTableProps> = ({ products }) => {
  return (
    <Table className="table-borderless mb-4">
      <TableHead>
        <TableHeading width={75} />
        <TableHeading>Product</TableHeading>
        <TableHeading>Price</TableHeading>
        <TableHeading>Inventory</TableHeading>
      </TableHead>
      <TableBody>
        {products.map((product) => (
          <TableRow key={product.id}>
            <TableData>
              <img
                src="https://picsum.photos/50/50"
                style={{ borderRadius: '8px' }}
              />
            </TableData>
            <TableData>{product.title}</TableData>
            <TableData>${product.price.toFixed(2)}</TableData>
            <TableData>{product.inventory} in stock</TableData>
          </TableRow>
        ))}
      </TableBody>
      <style jsx>{`
        .imageColumn {
          width: 75px !important;
        }
      `}</style>
    </Table>
  );
};

export default ProductsTable;
